import axios from 'axios';
import * as CONSTANTS from '../constants';

export const loginService = async (id) => {
  try {
    const { data } = await axios.get(`${CONSTANTS.BaseApi}${CONSTANTS.auth.login}`);
    return data
  } catch (error) {
      throw error
  }
};
